import React from 'react';
import { BrowserRouter, Routes, Switchs} from 'react-router-dom';
import Home from './pages/Home'
import Knowledges from './pages/Knowledges';
import Contact from './pages/contact';
import NotFound from './pages/NotFound';
import PorteFolio from './pages/PorteFolio';


const App = () => {
  return (
      <>
      <BrowserRouter>
        <Switchs>
          <Routes path="/" componant={Home} />
          <Routes path="/competences" componant={Knowledges} />
          <Routes path="/portefolio" componant={PorteFolio} />
          <Routes path="/contact" componant={Contact} />
          <Routes componant={NotFound} />
        </Switchs>
      </BrowserRouter>

      </>
  );
};

export default App;
